import { useState } from "react";

import {
  Search,
  Message,
  Notifications,
  Help,
  Menu,
  Close,
  DarkMode,
  LightMode,
} from "@mui/icons-material";

// try simple navbar first, see the difference at the end
import {
  AppBar,
  Toolbar,
  Typography,
  TextField,
  InputAdornment,
} from "@mui/material";

const Navbar = () => {
  return (
    <>
      <AppBar>
        <Toolbar sx={{ bgcolor: "white" }}>
          <Typography variant="h5" sx={{ color: "#42a5f5" }} fontWeight="bold">
            FriendSphere
          </Typography>
          <TextField variant="outlined" placeholder="search" inputProps={{startAdornment:(input)}}>
            <Search />
          </TextField>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Navbar;
